module RubbishLex

open Microsoft.FSharp.Text.Lexing
open RubbishPar

let lexemeAsString lexbuf = 
    LexBuffer<char>.LexemeString lexbuf


let keyword s =
    match s with
    | "if"      -> IF
    | "else"    -> ELSE
    | "switch"  -> SWITCH
    | "case"    -> CASE
    | "while"   -> WHILE
    | "for"     -> FOR
    | "break"   -> BREAK
    | "continue"-> CONTINUE
    | "def"     -> DEF
    | "null"    -> NULL
    | "import"  -> IMPORT
    | "return"  -> RETURN
    | "and"     -> SEQAND
    | "or"      -> SEQOR
    | "not"     -> NOT
    | "xor"     -> SEQXOR
    | "print" -> PRINT
    | "println" -> PRINTLN
    | "try"     -> TRY
    | "catch" -> CATCH
    | "finally" -> FINALLY
    | "range"   -> RANGE
    | "default" -> DEFAULT
    | "true"    -> CSTBOOL 1
    | "false" -> CSTBOOL 0 
    | "in"     -> IN
    | "lambda"  -> LAMBDA
    | "class"   -> CLASS
    | _         -> NAME s


let cEscape s = 
    match s with 
    | "\\\\" -> '\\'
    | "\\\"" -> '\"'
    | "\\a"  -> '\007'
    | "\\b"  -> '\008'
    | "\\t"  -> '\t'
    | "\\n"  -> '\n'
    | "\\v"  -> '\011'
    | "\\f"  -> '\012'
    | "\\r"  -> '\r'
    | _      -> failwith "Lexer error: impossible C escape"

